// Importing browser router, install it first --- npm i -D react-router-dom@latest
import { BrowserRouter, Routes, Route } from "react-router-dom";

// Importing components
import Template from "./components/Template";
import Nav from "./components/navbar/Nav";
import Footer from "./components/footer/Footer";
import Raymark from "./components/pages/Raymark/Error";
import Carlos from "./components/pages/Carlos/Error";
import Steven from "./components/pages/Steven/Error";
import Peter from "./components/pages/Peter/Error";
import Elijah from "./components/pages/Elijah/Error";
import Error from "./components/pages/error/Error";

import './App.css';

function App() {
  return (
    <div className="App">

      <BrowserRouter>

        {/* Importing the Nav component before nested routes */}
        <Nav />

        {/* Using the Routes and Route components from react-router-dom */}
        <Routes>
          <Route path="/" element={<Template />}>
            <Route path="/Raymark Tomas" element={<Error />} />
            <Route path="/Elijah Rafael Gaylan" element={<Error />} />
            <Route path="/Bryce Angeles" element={<Error />} />
            <Route path="/Steven Villacruz" element={<Error />} />
            <Route path="/Carlos Sobrevilla" element={<Error />} />
            <Route path="/Peter Aguilar" element={<Error />} />
            <Route path="*" element={<Error />} />
          </Route>
        </Routes>

        {/* Importing the Footer component after nested routes */}
        <Footer />

      </BrowserRouter>
      
    </div>
  );
}

export default App;
